Naughty Rich Girls - Misty Stone 

Release Date: February 25, 2011

Misty is waiting for her driver to come take her to the recording studio, her older and rich boyfriend has purchased for her. She is ready to lay down some tracks and then hit the malls for some serious shopping. Rocco, the driver, interrupts her phone conversation, not once but twice...and now Misty has had enough. She angrily confronts Rocco, and rips him a new asshole. As she is pushing him away, she notices how strong and cut he is. Her mood changes and now she is seducing him right there. He can't say no, and she won't take no for an answer. It seems she will be singing Rocco's sexual praises today.
